def binary_exp(x, y, p):
    """Compute x^y modulo p."""
    if y == 0:
        return 1
    elif y % 2 == 0:
        return binary_exp((x * x) % p, y // 2, p)
    else:
        return (x * binary_exp((x * x) % p, y // 2, p)) % p


