def fibfib_helper(n, memo):
    if n == 0:
        return 0
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    elif memo[n] is not None:
        return memo[n]
    else:
        result = fibfib_helper(n-1, memo) + fibfib_helper(n-2, memo) + fibfib_helper(n-3, memo)
        memo[n] = result
        return result

memo = [None] * (n + 1)
return fibfib_helper(n, memo)


