def max_buckets(grid, capacity):
    bucket_count = 0
    bucket_capacity = capacity
    bucket_used = 0
    for row in grid:
        for cell in row:
            if cell == 1:
                bucket_used += 1
                while bucket_used >= bucket_capacity:
                    bucket_used -= bucket_capacity
                    bucket_count += 1
    return bucket_count

